insert  into `exam_subject_choices`(`id`,`category_id`,`subject_name`,`type`,`answer`,`score`,`analysis`,`level`,`create_by`,`create_time`,`update_by`,`update_time`,`del_flag`) values (5000001,2220002,'自计算机问世至今已经经历了四个时代，划分时代的主要依据是计算机的_',0,'A',6,'',2,'admin','2019-06-19 18:26:45','钟经理','2020-05-16 15:19:10','0'),(5000002,2220002,'第一台计算机是在1946年在美国诞生，该机的英文缩写是_',0,'B',5,'无',2,'admin','2019-06-19 18:27:19','钟经理','2020-05-17 11:48:04','0'),(5000003,2220002,'当前的计算机一般被认为是第四代计算机，它所采用的逻辑元件是_',0,'A',5,'无',2,'admin','2019-06-19 18:27:52','钟经理','2020-05-16 15:34:24','0'),(5000004,2220002,'当前计算机的应用最广泛的领域是_',0,'C',5,'无',2,'admin','2019-06-19 18:28:22','admin','2019-06-19 18:28:22','0'),(5000005,2220002,'早期的计算机体积大、耗电多、速度慢，其主要原因是制约于_',0,'D',5,'无',2,'admin','2019-06-19 18:28:51','admin','2019-06-19 18:28:51','0'),(5000006,2220002,'现代计算机之所以能够自动、连续地进行数据处理，主要是因为_',0,'D',5,'无',2,'admin','2019-06-19 18:29:22','admin','2019-06-19 18:29:22','0'),(5000007,2220002,'电子计算机按规模和处理能力划分，可以分为_',0,'C',5,'无',2,'admin','2019-06-19 18:29:47','admin','2019-06-19 18:29:47','0'),(5000008,2220002,'将计算机分为通用计算机、专用计算机两类的分类标准是_',0,'B',5,'无',2,'admin','2019-06-19 18:30:12','admin','2019-06-19 18:30:12','0'),(5000009,2220002,'既可以接收、处理和输出模拟量，也可以接收、处理和输出数字量的计算机是_',0,'C',5,'无',2,'admin','2019-06-19 18:30:44','admin','2019-06-19 18:30:44','0'),(5000010,2220002,'至今日，计算机仍采用存储程序原理，原理的提出者是_',0,'C',5,'无',2,'admin','2019-06-19 18:31:11','admin','2019-06-19 18:31:11','0'),(5000011,2220002,'《小雅·鹿鸣》本是西周贵族宣扬宴飨之仪的乐歌，后扩散到民间，在乡人宴会上也可传唱。这表明西周时期',0,'B',5,'无',2,'admin','2019-10-20 20:06:09','admin','2019-10-20 19:57:27','0'),(5000012,2220002,'公元前 212 年，秦始皇坑杀“术士”，长子扶苏劝谏说：“远方黔首未集，诸生皆诵法孔子，今上皆重法绳之，臣恐天下不安，唯上察之”。这反映当时',0,'D',5,'',2,'admin','2019-06-19 18:32:44','admin','2019-06-19 18:32:44','0'),(5000013,2220002,'唐前期的政治人物多为北方人，北宋时政治人物多出生于江西、福建、苏南等地。这一变化主要反映了',0,'C',5,'',2,'admin','2019-06-19 18:33:11','admin','2019-06-19 18:33:11','0'),(5000014,2220002,'李鸿章凭淮军实力日渐强盛。一次，他在游孔林时说道：“孔子不会打洋枪，今不足贵也。”李鸿章这样评价孔子，其背景最可能是',0,'B',5,'',2,'admin','2019-06-19 18:33:37','admin','2019-06-19 18:33:37','0'),(5000015,2220003,'《荆楚岁时记》云：“社日，四邻并结宗会社，宰牲牢，为屋于树下，先祭神，然后食其胙。”据此可知，社日的民俗功能主要是',0,'B',6,'',3,'admin','2019-06-19 18:34:05','钟经理','2020-05-16 12:42:17','0'),(5000016,2220003,'李鸿章凭淮军实力日渐强盛。一次，他在游孔林时说道：“孔子不会打洋枪，今不足贵也。”李鸿章这样评价孔子，其背景最可能是',0,'A',5,'',2,'admin','2019-06-19 18:34:36','钟经理','2020-05-17 10:50:42','0'),(5000017,2220003,'1930 年，中共中央在回应共产国际指示时说：党的任务决不是准备夺取部分的政权，如果认为现在还是准备夺取部分的政权,无疑是对革命形势估量不足的右倾观念。这一回应表明',0,'B',5,'',2,'admin','2019-06-19 18:35:03','钟经理','2020-05-16 13:23:15','0'),(5000018,2220003,'1938 年初，国民政府颁布多部法规，要求将每一工厂、商号、银行、钱庄都纳入到同业工会内，又将每一同业工会纳入当地商会内。这些法规',0,'D',5,'',2,'admin','2019-06-19 18:35:26','admin','2019-06-19 18:35:26','0'),(5000019,2220003,'古代雅典法律规定：每个公民从出生起，城邦就是他的最高监护人，要按城邦的需要来抚养和教育。这反映出雅典',0,'A',5,'',2,'admin','2019-06-19 18:35:49','admin','2019-06-19 18:35:49','0'),(5000020,2220003,'19 世纪末 20 世纪初，一向傲慢的英国人惊奇地发现：“身上的衣服是德国缝制的，少女们周末穿的漂亮披风与上衣来自德国。更让人吃惊的是生活中有许多东西都产自德国，……连周末歌剧院里上演的歌剧也是德国人创作的，演员无一例外是德国人。”可见，当时傲慢的英国人',0,'D',5,'',2,'admin','2019-06-19 18:36:10','admin','2019-06-19 18:36:10','0'),(5000021,2220003,'1920–1921 年，苏俄许多工人流往农村，还有一些则自谋生路成了小手工业者。据此推知当时苏俄',0,'A',5,'',2,'admin','2019-06-19 18:36:43','admin','2019-06-19 18:36:43','0'),(5000022,2220003,'1964 年 6 月，美国《时代》杂志发表社论指出：“从北约到联合国，从拉丁美洲到红色中国，几乎在世界政治中的每一个问题或地区上，法国都采取和美国政策不一致的态度。”这一社论',0,'B',5,'',2,'admin','2019-06-19 18:37:08','admin','2019-06-19 18:37:08','0'),(5000023,2220006,'<p>自计算机问世至今已经经历了四个时代，划分时代的主要依据是计算机的_</p>',0,'D',5,'',3,'admin','2020-03-17 20:21:29','com','2020-04-10 00:30:44','0'),(5000024,2220007,'<p>32</p>',0,'B',5,'233',2,'admin','2020-03-17 20:21:47','钟经理','2020-05-15 10:57:11','0'),(5000025,2220004,'2',0,'B',5,'2',2,'admin','2019-09-23 22:50:09','admin','2020-04-15 23:05:32','0'),(5000026,2220004,'2',0,'B',5,'2',2,'admin','2019-09-23 22:55:59','admin','2019-09-23 22:55:59','0'),(5000027,2220004,'1',0,'A',5,'1',2,'admin','2019-10-07 15:46:31','admin','2019-10-07 15:46:31','0'),(5000028,2220004,'1',0,'A',5,'555',2,'admin','2020-01-18 15:30:07','admin','2020-01-18 15:30:07','0'),(5000029,2220004,'计算机网络多选题',3,'A,B',5,'1',2,'admin','2020-01-31 15:03:38','com','2020-04-16 08:07:56','0'),(5000030,2220004,'2',0,'B',5,'2',2,'admin','2020-01-31 14:56:05','admin','2020-01-31 14:56:05','0'),(5000031,2220004,'3',3,'A,C',5,'3',2,'admin','2020-01-31 15:00:50','admin','2020-01-31 15:00:50','0'),(5000032,2220006,'1',3,'B,D',5,'1',2,'admin','2020-01-31 15:24:22','admin','2020-01-31 15:24:22','0'),(5000033,2220006,'选择题1',0,'A',5,'选择题1',2,'admin','2020-02-18 22:32:10','admin','2020-02-18 22:32:10','0'),(5000034,2220006,'选择题2',0,'B',5,'选择题2',2,'admin','2020-02-18 22:32:29','admin','2020-02-18 22:32:29','0'),(5000035,2220006,'选择题3',0,'C',5,'选择题3',2,'admin','2020-02-18 22:33:00','admin','2020-02-18 22:33:00','0'),(5000036,2220006,'多选题',3,'A,C',5,'多选题',2,'admin','2020-02-19 13:25:52','admin','2020-02-19 13:25:52','0'),(5000037,22200010,'测试两个选项',0,'A',5,'测试两个选项',2,'admin','2020-02-19 22:08:02','admin','2020-02-19 22:08:02','0'),(5000038,2220009,'产品',0,'A',10,NULL,1,'admin','2020-04-11 23:06:38','',NULL,'0');

/*Table structure for table `exam_subject_group` */

DROP TABLE IF EXISTS `exam_subject_group`;

CREATE TABLE `exam_subject_group` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `category_name` varchar(45) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `subs_xz` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci,
  `subs_pd` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci,
  `subs_jd` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci,
  `create_time` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;

/*Data for the table `exam_subject_group` */

/*Table structure for table `exam_subject_judgement` */

DROP TABLE IF EXISTS `exam_subject_judgement`;

CREATE TABLE `exam_subject_judgement` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `category_id` bigint(20) DEFAULT NULL COMMENT '分类ID',
  `subject_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '题目名称',
  `type` tinyint(4) DEFAULT '2' COMMENT '题型',
  `answer` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL DEFAULT '' COMMENT '参考答案',
  `score` int(11) NOT NULL DEFAULT '0' COMMENT '分值',
  `analysis` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '解析',
  `level` tinyint(4) NOT NULL COMMENT '难度等级',
  `create_by` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '' COMMENT '创建人',
  `create_time` datetime DEFAULT NULL COMMENT '创建时间',
  `update_by` varchar(128) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '' COMMENT '修改人',
  `update_time` datetime DEFAULT NULL COMMENT '修改时间',
  `del_flag` char(4) DEFAULT '0' COMMENT '删除标记 0:正常;1:删除',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=10000009 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT COMMENT='简答题表';

